               <h1 class="o-title--class-schedule">Spring 2026 Class Schedule</h1>
               <div class="o-wrap--content">
                  <p>There are three different types of modes of instruction: <a href="/classes/symbols-abbreviations.php#instruction%20mode">Fully Online, Hybrid, and In-Person</a> (definitions linked).&nbsp;<strong>Some instruction modes and classes times may change before registration opens<em>. </em></strong><em>&nbsp;</em></p>
                  
                  <h2>Calendar</h2>
                  
                  <p>The <a href="/registrar/calendar/spring-2026.php">Spring 2026 Registration Calendar</a> includes registration, grade posting, and academic standing deadlines.</p>
                  
                  <p>The <a href="/classes/final-exam-schedule/spring-2026.php">Spring 2026 Culminating Activities and Final Examination Period</a>&nbsp;are scheduled from Wednesday-Friday, May 14-16 and Monday-Tuesday, 19-20, 2025. Effective
                     Spring 2025 per the revised <a href="/classes/final-exam-schedule/policy.php">University Policy S17-11</a>, the&nbsp; schedule will begin at 8:30 am rather than 7:30 am. All slots will be two (2)
                     hours in length rather than two hours (2) and fifteen (15) minutes.</p>
                  
                  <p>The <a href="/commencement/index.php">Spring 2026 Commencement</a> is scheduled for Wednesday-Friday, May 20-22, 2026.</p>
                  
                  <h2>Class Schedule Listing</h2>
                  
                  <p>If the below table is not loading, please visit the <a href="/classes/register/myscheduler.php">MyScheduler Tool</a>. You may also use the <a href="https://one.sjsu.edu/collection/all/mysjsu">MySJSU Class Search feature</a>, but please note that the class number filter “greater than” or “less than” options
                     do not currently work properly and will be temporarily removed.</p>
                  <!--Current Type is blank-->
                  <details class="sjsu-accordion">
                     <summary>
                        Online Learning Readiness
                        </summary>Before enrolling in an online course, students should first assess their readiness
                     for stepping into the online learning environment by completing the&nbsp;<a href="/ecampus/how-we-can-help/online-learning-readiness.php">Online Learning Readiness Questionnaire.</a></details>
                  <details class="sjsu-accordion">
                     <summary>
                        Subject Notes
                        </summary>
                     
                     <p>Subject Notes, also referred to as Global Notes, provide more details about a specific
                        subject, course and/or section. Available for courses with subject codes: Spring 2026</p>
                     </details>
                  <details class="sjsu-accordion">
                     <summary>
                        Using the Search
                        </summary>
                     
                     <p>Use the Search bar to filter by section and/or mode of instruction (e.g. typing "Fully
                        Online MATH" will provide a list of all MATH courses taught fully online.)</p>
                     
                     <p>When the schedule indicates TBA (to be announced) it means that the class is scheduled
                        with no designated day/time meetings.</p>
                     
                     <p>Real-time class listings, including textbook and course information, are found in
                        the <a href="https://one.sjsu.edu/collection/all/mysjsu">MySJSU Class Search</a>.</p>
                     </details>
